script: |
  super -f text -I q11966.spq | sort > q11966.out

inputs:
  - name: q11966.spq
    data: |
      SELECT col0 / - + col0 FROM tab2 (FORMAT parquet) WHERE NOT + col1 * + 86 * - - col2 * + - ( + + col0 ) IS NULL;
  - name: tab2

outputs:
  - name: q11966.out
    data: |
      -1
      -1
      -1
